}

function Home() {
        return (
            <Card style={{ backgroundColor: "lavender", color: "black", width: "18rem" }}>
                <Card.Header>Fabricadabra Home Page</Card.Header>
                {/* <Card.Img variant="top" src={banklogo} alt="Responsive image" className="img-fluid"/> */}
